import React, { createContext,usEs } from "react";
export const CompanyServiceList = createContext();
function CompanyData(props) {
  const CompanyListDataArray = [
    {
      id: 1,
      companyName: "JRUN cleaning service",
      aboutCompany:
        "Lorem ipsum dolor sit amet consectetur adipisicing elit.Provident atque temporibus similique saepe obcaecati magni eligendi optio sequi ullam, earum porro veritatis repellendus voluptate alias odio ratione dolor iusto tempore.",
      // serviceList: [
      //   "homeCleaning",
      //   "hotel cleaning",
      //   "office cleaning",
      //   "deep cleaning",
      // ],
      minPrice: 3000,
      maxPrice: 6500,
    },

    {
      id: 2,
      companyName: "BrentFord cleaning service",
      aboutCompany:
        "Lorem ipsum dolor sit amet consectetur adipisicing elit.Provident atque temporibus similique saepe obcaecati magni eligendi optio sequi ullam, earum porro veritatis repellendus voluptate alias odio ratione dolor iusto tempore.",
      // serviceList: [
      //   "homeCleaning",
      //   "hotel cleaning",
      //   "office cleaning",
      //   "deep cleaning",
      //   "post construction",
      //   "after party",
      // ],
      minPrice: 4000,
      maxPrice: 8500,
    },

    {
      id: 3,
      companyName: "Goodwill cleaning service",
      aboutCompany:
        "Lorem ipsum dolor sit amet consectetur adipisicing elit.Provident atque temporibus similique saepe obcaecati magni eligendi optio sequi ullam, earum porro veritatis repellendus voluptate alias odio ratione dolor iusto tempore.",
      // serviceList: [
      //   "homeCleaning",
      //   "hotel cleaning",
      //   "office cleaning",
      //   "deep cleaning",
      //   "post construction",
      //   "after party",
      // ],
      minPrice: 2500,
      maxPrice: 4500,
    },
  ];
  return (
    <CompanyServiceList.Provider value={{ CompanyListDataArray }}>
      {props.children}
    </CompanyServiceList.Provider>
  );
}
export default CompanyData;
